The 2019–20 Cayman Islands Premier League was the 41st season of the &lt;a href="Cayman%20Islands%20Premier%20League"&gt;Cayman Islands Premier League&lt;/a&gt;, the top division &lt;a href="association%20football"&gt;football&lt;/a&gt; competition in the &lt;a href="Cayman%20Islands"&gt;Cayman Islands&lt;/a&gt;. The season began on 19 October 2019. The season was indefinitely postponed on 12 March 2020, due to the &lt;a href="COVID-19%20pandemic%20in%20the%20Cayman%20Islands"&gt;Coronavirus pandemic&lt;/a&gt;. The season is resumed on 15 August. Bodden Town won their fourth league title.
